function Register(){
    return(
        <div className="Register">
            <form>
                <input type="text" id="username" placeholder="Username"></input><br></br>
                <input type="text" id="password" placeholder="Password"></input><br></br>
                <input type="text" id="password" placeholder="Confirm Password"></input><br></br>
                <input type="submit" id="submit" value="Submit"></input>
            </form>
        </div>
    );
}

export default Register;
